import {jwtDecode} from 'jwt-decode';

function Dashboard(){
    const dates = jwtDecode(localStorage.getItem('token'));
    console.log(dates);
    return(
        
        <h1>welcome {dates.name} {dates.lastName}</h1>
    );
};
export default Dashboard;
